INSERT INTO `posts` VALUES (3794,'https://www.peopleperhour.com/css/pph2/images/pph2-share.png',NULL,NULL,'PeoplePerHour.com','I require spec sheet and tech pack for ladies lounge wear range','https://rss.app/articles/862477a672d6712ebf10d2bcdf5e69dfe110aa4e58f40f7d5744d5ff444bc49a4abe821c8c6928f4d133bec0d30012a55541f805d385cfec48a45ef03c6d67b251e129da48c9fe2e7d22d4c525cfca31bda263bce8a412cf675ea156e80b509f0c48aaf3ea04863fa07bdd4631c2c405f6ec1a5cb93447c64cb7bf33897d592bb510fb0e6792eb12bb','https://www.peopleperhour.com/css/pph2/images/pph2-share.png','<div>\n<img src=\"https://www.peopleperhour.com/css/pph2/images/pph2-share.png\"><div>I need a tech pack inc spec sheets for ladies loungewear designs and would like to begin the process as soon as possible.</div>\n</div>',NULL,'job','en','2020-02-06 02:57:38','2020-02-06 02:57:38'),(3795,'https://www.peopleperhour.com/css/pph2/images/pph2-share.png',NULL,NULL,'PeoplePerHour.com','Wordpress Banner Plugin Expert - Freelancers Only','https://rss.app/articles/862477a672d6712ebf10d2bcdf5e69dfe110aa4e58f40f7d5744d5ff444bc49a4abe821c8c6928f4d133bec0d31312b41142f35cc2c4d3f44cb344a9707667b45df835d814d3fc2b7721c5dc25cf9431e0a561fff5a90587631fb55fe548099f1750e2f1ff4a8b60a371c30a33c0c51ee0b2585eba3804931eaafe64d039','https://www.peopleperhour.com/css/pph2/images/pph2-share.png','<div>\n<img src=\"https://www.peopleperhour.com/css/pph2/images/pph2-share.png\"><div>EXPERIENCED USERS ONLY - FREELANCERS - AD HOC WORK - WE WILL WHATSAPP for COMMUNICATION We have a small Wordpress Job but its ongoing What we need first is someone with experience is using the Advanced Banners plugin which we will be using on our website : https://wordpress.org/plugins/advanced-ads/ We will be using the Pro version. Please read and see video below before applying for this job. Please send examples of websites where you have used this plugin or similar. https://wordpress.org/plugins/advanced-ads/ Advanced ADs Pro https://wpadvancedads.com/add-ons/advanced-ads-pro/ ***** https://vimeo.com/297786830 https://vimeo.com/user80091737 https://wpadvancedads.com/add-ons/all-access/ AD Placement :https://wpadvancedads.com/manual/placements/ https://www.youtube.com/watch?time_continue=134&amp;v=c6kH-ut_IlA&amp;feature=emb_logo https://wpadvancedads.com/add-ons/advanced-ads-pro/ https://wpadvancedads.com/add-ons/tracking/ https://wpadvancedads.com/add-ons/responsive-ads/ PLEASE STATE CLEARLY YOU EXPERIENCE WITH THIS PLUGIN AS WE NEED TO USE IT ON OUR WEBSITE.....</div>\n</div>',NULL,'job','en','2020-02-06 02:57:38','2020-02-06 02:57:38'),(3796,'https://dw3i9sxi97owk.cloudfront.net/uploads/jobAttachments/UxAYlA3qRQO4WwvYMhPv_744BBD86-294A-4425-885C-33779ADF1BBE.png',NULL,NULL,'PeoplePerHour.com','I’m looking for a small flier designing','https://rss.app/articles/862477a672d6712ebf10d2bcdf5e69dfe110aa4e58f40f7d5744d5ff444bc49a4abe821c8c6928f4d133bec0d30705b35d52ff5cc285ddf655a505ad30727ca34bfb68d44acdfe30773ccac539cdca24a2b52df0b6bf1acb7f1fed5ee04f41884244e2f0e200837ba87382596a93965ba4ad','https://dw3i9sxi97owk.cloudfront.net/uploads/jobAttachments/UxAYlA3qRQO4WwvYMhPv_744BBD86-294A-4425-885C-33779ADF1BBE.png','<div>\n<img src=\"https://dw3i9sxi97owk.cloudfront.net/uploads/jobAttachments/UxAYlA3qRQO4WwvYMhPv_744BBD86-294A-4425-885C-33779ADF1BBE.png\"><div>I need a small A4 flier designing to advertise my Bingo machine and PA system for “hire” This comes complete with Bingo books plus myself as the host/caller of numbers. The events present themselves as great fund raising opportunities for Pubs, Clubs , Village Halls, Day care centres and offer a great social event. Therefore I need a “ catchy slogan “ that stands out</div>\n</div>',NULL,'job','en','2020-02-06 02:57:38','2020-02-06 02:57:38'),(3797,'https://www.peopleperhour.com/css/pph2/images/pph2-share.png',NULL,NULL,'PeoplePerHour.com','PASSIONATE COPYWRITER,EDITOR AND PROOFREADER ARE NEEDED!!!','https://rss.app/articles/862477a672d6712ebf10d2bcdf5e69dfe110aa4e58f40f7d5744d5ff444bc49a4abe821c8c6928f4d133bec0d31305bf484ff84d88cdd8ed55bf44ba72717aa956ee35d806c4ba327f7cd1cd24d98e2da3a674f4b6af18da6a04b251f84356d70a44eef7e415c073a870821b2fcccf0ae1fa5654b33304c05bffe5388d6a103cb010fb0e6791e910b3','https://www.peopleperhour.com/css/pph2/images/pph2-share.png','<div>\n<img src=\"https://www.peopleperhour.com/css/pph2/images/pph2-share.png\"><div>We are looking for a passionate proofreader, editor and aspiring copywriter to fill in the advertised role . Our major required is your PASSION and CREATIVITY but a person who has military background and also pays attention to details is welcome too. Your role and responsibilities are as follows : Responsibilities (i)- Write copy for a variety of media including social, print, video, and online. (ii)- Edit and proof work to ensure high editorial standards are met across all content outputs. (iii)- Collaborate with creative, product, marketing, and legal to assess project needs and help with messaging. (iv)- Drive brand consistency across all company communications. (v)- Develop and implement brand guidelines. (vi)- Stay current on trends and competitors within the editorial sphere See projects through the whole creative lifestyle, from inception to deployment. Qualifications (i)- Experience in content marketing or copy writing, preferably with an agency Knowledge of Microsoft Office Applications. (ii)- Strong creative thinking skills and ability to think conceptually. (iii)- Comfortable working independently with little direction under tight deadlines. (iv)- Excellent writing, editing, and proofreading skills with a diligent eye for detail, language, flow, and grammar. (v)- Proven ability to demonstrate brand voice. (vi)- Strong attention to detail Excellent portfolio of work.</div>\n</div>',NULL,'job','en','2020-02-06 02:57:38','2020-02-06 02:57:38'),(3798,'https://www.peopleperhour.com/css/pph2/images/pph2-share.png',NULL,NULL,'PeoplePerHour.com','Recruitment for Web Articles','https://rss.app/articles/862477a672d6712ebf10d2bcdf5e69dfe110aa4e58f40f7d5744d5ff444bc49a4abe821c8c6928f4d133bec0d31305bf484ff84d88cad0eb46fb4baf2b686baa5ca530cf0ed4ba327f7cd3c934d8922bb9aa65ffefe111c5615eb75dee0b45881b49e4efee14c020f124995c689b','https://www.peopleperhour.com/css/pph2/images/pph2-share.png','<div>\n<img src=\"https://www.peopleperhour.com/css/pph2/images/pph2-share.png\"><div>We\'re looking for freelancers for creating content to be used on our websites and social media platforms. Here are the requirements of our article: 1. Desired Word Count: 1000 words 2. Take the SEO, URL, title and description issues into consideration while creating articles. 3. Mentioned our website name 3 or more times in the article. Such as: \"If you want more advice on skincare and make-up, please go to XXX to get more beauty information\". Here is a simple example, you can use any kinds of narrative form you feel comfortable. 4. We don\'t need revisions, but we want your article to be high quality, and we may consider to contract with you for a long-term cooperation. 5. Write articles within the outlines provided by us: the field is about beauty (skincare/makeup/hair/body care/perfume). Your topic will be like \"8 best face serum for oily skin\" 6. You can choose the products by yourself, but we have some requirements of products choosing. We will send the product choosing requirement along with the topic to you. 7. We need you to finish the article within 48 hours after receiving the topic. If you think you can meet our needs, please let me know how much would you charge for the article (It would be better if you’d like to post this article)</div>\n</div>',NULL,'job','en','2020-02-06 02:57:38','2020-02-06 02:57:38'),(3799,'https://baaeed.hsoubcdn.com/public/images/favicon.ico',NULL,NULL,NULL,'Fal systems : مُطور ودعم فني PHP بدوام جزئي','https://baaeed.com/remote-jobs/falsystems-%D9%85%D8%B7%D9%88%D8%B1-%D9%88%D8%AF%D8%B9%D9%85-%D9%81%D9%86%D9%8A-php-%D8%A8%D8%AF%D9%88%D8%A7%D9%85-%D8%AC%D8